import React from 'react'
import './Sortbar.css'
import { useSelector } from 'react-redux'
import { showAllProducts } from '../../features/cart/cartSlice'


function Sortbar() {
    const products = useSelector(showAllProducts)
    const classicRolls = products.filter(item => item.type === 'maki')

    console.log(classicRolls);
    return (
        <ul className="sort-nav">
            <li>All</li>
            <li>Classic</li>
            <li>Maki</li>
            <li>Dragons</li>
            <li>Baked</li>
            <li>Felix</li>
            <li>Sweet</li>
        </ul>
    )
}

export default Sortbar
